import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul className="">
        <li>
        <h1 className="Logo">NBA Scores</h1>
        </li>
        <li>
          <a href="#">Scores</a>
        </li>
        <li>
          <a href="#">Leaders</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
      </ul>
    </div>
  );
}

export default App;
